import './App.css';
import { Router, Routes, Route } from 'react-router-dom'
import Navbar from './components/navbar'
import Container from './components/container'

function App() {
  return (
    <Router>

      <Navbar />
      <Routes>
        <Route path='/' element={<Container />} />
      </Routes>


    </Router>

  );
}

export default App;
